import React, { Component } from "react";
import StudentService from "./StudentService";
import Button from "antd/es/button";
import Rate from "antd/es/rate";
import CompanyRatingList from "./CompanyRatingList";

class StudentRatingComponent extends Component{
    constructor(props) {
        super(props);
        this.state = {
            projectList: []
        }
    }
    componentDidMount() {
        StudentService.getStudentProjects().then(response => {
            this.setState({
                projectList: response.data
            });
            console.log(this.state.projectList)
        })
    }

    render() {
        return (
            this.state.projectList.map(
                project =>
                <CompanyRatingList projectList={project} />
            )
        );
    }
}

export default StudentRatingComponent;
